description:
Verenigde Staten
Actie / Thriller
104 minuten

goed

met Lucas Black, Nathalie Kelley en Sung Kang

Shaun Boswell was altijd al een buitenbeentje. Zijn enige binding met de buitenwereld is illegaal straatracen. Om aan celstraf te ontkomen moet hij naar zijn vader in Tokio die daar in het leger zit. Japan is nu net het land waar het straatracen is uitgevonden... Bij zijn eerste mislukte poging neemt hij het op tegen de &quot;Drift King&quot; die banden heeft met de Japanse maffia, Yakuza. Hij begeeft zich noodgedwongen in de onderwereld van Tokio in een spel op leven en dood;
